import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div className="App">
      <ul>
        <li>html</li>
        <li>css</li>
        <li>js</li>
        <li>react</li>
      </ul>
      <Header></Header>
    </div>
  );
};

const Header = () => {
  return (<div>
    <a>home</a>
    <a>about</a>
    <a>news</a>
    <a>contact</a>
  </div>
  );
};

export default App;
